function CurrentWeather({datetime, weatherCondition, cityName, sunsetTime, currentTemperature, sunriseTime, observedTime, weatherIcon}){
   if (!datetime) return null
   console.log(datetime + "HIIIIIII")



    return(
        <>
        <Container>
        <Grid>
          <Grid.Column textAlign="center">
        DATE:
        {datetime}
        WEATHER CONDITION: 
        {weatherCondition}
        ICON:
        <Image src={weatherIcon} className='logo' /> 
        CITY NAME: 
        {cityName}
        SUNRISE TIME:
        {sunriseTime}
        SUNSET TIME:
        {sunsetTime}
        CURRENT TEMP:
        {currentTemperature}
        TIME WEATHER LAST OBSERVED:
        {observedTime}
            </Grid.Column>
        </Grid>
        </Container>




        </>
    )


}



export default CurrentWeather;
